import React from 'react'
import {Header, Strona} from './components/ClassComponent'

function App() {
    const [theme, setDarkTheme] = React.useState(false)
    return (
        <div class={theme ? 'dark-theme' : 'light-theme'}>
            <Header>
            <div>
                <button onClick={() => setDarkTheme(theme => !theme)}>
                    {theme ? 'Dark Mode' : 'Light Mode'}
                </button>    
            </div></Header>
            <Strona></Strona>
        </div>      
    );

}

export default App;
